export class User {
  room: String = 'AndrewPaes'; // set your room name
  name: String = 'MR 139'; // set your room name

  constructor() {
    this.room = 'AndrewPaes';
  }

  getRoom() {
    return this.room;
  }

  setame(roomName: String) {
    this.room = roomName;
  }

  getName() {
    return this.name;
  }

  setName(name: String) {
    this.name = name;
  }
}
